post_text:
These are the 5 forensicators who qualified for State Champs, which would have been held Saturday, May 2. Our season was cut nearly in half, but these talented, hard working rock stars made the most of it. Please join me in celebrating Senior Sarah Shaffer-Humorous Solo Acting and Impromptu Speaking; Junior Emily Pachta-Duet Acting, Duo Interpretation, and Improvised Duet Acting(all with partner, Carter Topliff) Junior Carter Topliff- Duet Acting, Duo Interpretation, Improvised Duet Acting, (all with partner, Emily Pachta) and Informative Speaking;
Freshman Josephine Benson-Duet Acting (with partner, Brooklyn Watson);
Freshman Brooklynn Watson- Duet Acting (with partner, Josephine Benson) and Impromptu Speaking
Losing the opportunity to compete at State was a kick in the teeth, but these amazing humans kept right on smiling. All the while, prepping to get right there next year. 💜
Thanks, Wamego Drama Boosters and Lorinda Sultzer, for helping us recognize these champions!

